// Marks.js
import { line, curveCardinal } from 'd3';

export const Marks = ({
  data,
  xScale,
  yScale,
  xValue,
  yValue,
  circleRadius
}) => {
  const lineGenerator = line()
    .x(d => xScale(xValue(d)))
    .y(d => yScale(yValue(d)))
    .curve(curveCardinal); // Smooth line

  return (
    <>
      <path
        className="line"
        d={lineGenerator(data)}
        fill="none"
        stroke="steelblue"
        strokeWidth="2"
      />

      {data.map((d, index) => (
        <circle
          key={index}
          cx={xScale(xValue(d))}
          cy={yScale(yValue(d))}
          r={circleRadius}
          fill="red"
          stroke="black"
        />
      ))}
    </>
  );
};
